function parseData(e,t){var n=[];var r=[];switch(t){case"textarea":lines=e.split("\n");for(var i=0;i<lines.length;i++){if(lines[i].length==0)continue;var s=lines[i].split(",");var o=s.shift();var u=[];for(j=0;j<s.length;j++)u.push(parseFloat(s[j]));r.push(u);n.push(o)}break;case"vector":for(var i=0;i<e.length;i++){var u=[];for(var a=0;a<e[i].length;a++){if(a==0){var o=e[i][a]}else{u.push(parseFloat(e[i][a]))}}n.push(o);r.push(u)}break;default:break}return{labels:n,vectors:r}}function isAPIAvailable(){if(window.File&&window.FileReader&&window.FileList&&window.Blob){return true}else{alert("Maybe you are using an outdated or non-compliant HTML5 browser. Please, change or update your browser.");return false}}function stringStripper(e){if(e.length>=16){return e.substring(0,16)+"..."}else{return e}}function closeResults(){$("#resultSection").animate({height:"0px"},1e3,function(){showResults(false)})}Array.prototype.unique=function(){var e={},t,n=this.length,r=[];for(t=0;t<n;t+=1)e[this[t]]=this[t];for(t in e)r.push(e[t]);return r}
